import './LandingPage.css';
import Register from '../UserMgmt/Registeration'
import SignIn from '../UserMgmt/Registeration'
import {useState} from 'react'

function LandingPage() {
    const [State, setState] = useState("Registerbtn");
    const Showsignup=()=>
    {
        setState("Register");
    } 
    const Showsignin=()=>
    {
        setState("Signin");
    }
    return (
        <div>
            <div class="header">
                <div class="header-left-component">
                    <div>
                        <label>Welcome to landing page</label>
                        </div>
                </div>  
                <div class="header-right-component">
                    <div class="header-right-component-right">
                    <div class="dvSignIn">
                        <label><a href="#" onClick={Showsignin}>Sign In</a></label>
                    </div>
                            <div class="dvSignUp">
                                <label><a href="#" onClick={Showsignup}>Sign Up</a></label>
                            </div>
                    </div>                  
                </div>
            </div>
            <div class="content">
                {State == "Register" &&
                    <Register></Register>
                }
                {State == "Signin" &&
                    <Register></Register>
                }
            </div>           
        </div>
    );
}
export default LandingPage;
